import React, {useState} from 'react';
import Diapo from '../../data/diapo.json';

const {image} = Diapo;

const Main = (props) => {
  const [apppath, setApppath] = useState({})

  return (
    <main className="container row">
      <div className="">
        {
          image.map((img,k) => {
            return <img key={k}
              alt={img.alt}
              className={img.selecteur}
              src={setApppath(img.path)} />
           })
        }
    </div>
  </main>
)
}

export default Main;
